// import {useDispatch, useSelector} from 'react-redux';
import {getDogs, sortDogsByWeight, sortDogsByLetter, filterCreated, getTemperaments, filterByTemperaments} from "../actions/index.js";
// import {Link} from "react-router-dom";
// import Dogcard from "./Card.jsx"
// import Paged from "./Paging.jsx";
// import SearchBar from "./SearchBar";
// import Style from "./Home.module.css";

import { useSelector,useDispatch } from "react-redux";

export default function CategoriaDePerritos(handlerFilterTemperaments) {
    useEffect(()=>{
        dispatch(getTemperaments)
    },[])
    const dispatch=useDispatch()
    const temperaments=useSelector(state=>state.temperaments)
  return (
    <div>
      <select
        // className={Style.filter}
        onChange={(e) => handlerFilterTemperaments(e)}
      >
        {temperaments &&
          temperaments.map((e) => {
            return (
              <option key={e.id} value={e.name}>
                {e.name}
              </option>
            );
          })}
      </select>
    </div>
  );
}
